// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import "./AddressLib.sol";
import "./BirthDataLib.sol";
import "./EntityMetaInformationLib.sol";
import "./XpectoLib.sol";

library UserLib {


    enum PostIdentVerificationStatus {
        NEW,
        INPROGRESS,
        COMPLETED
    }

    enum PersonType {
        NATURAL_PERSON,
        LEGAL_PERSON,
        MARRIAGE,
        INHERITANCE
    }
    enum Maritalstatus {
        SINGLE,
        MARRIED,
        DIVORCED,
        WIDOWED,
        CIVILPARTNERSHIP,
        SUSPENDEDCIVILPARTNERSHIP,
        PERTNERDECEASED,
        UNKNOWN
    }

    enum Role {
        INVESTOR,
        POWER_PLANT_OWNER       
    }



    enum IdentityState {
        NEW,
        INITIATED,
        CANCELED,
        SUCCEEDED, 
        FAILED
    }

    struct Identity {
        IdentityPersonalData personalData; //
        IdentityAdditionalData additionalData; //
        IdentityContactData contactData; //
        EntityMetaInformation metaInformation; //
        XpectoData xpectoData;
        Address userAddress; // !=0
        PostIdentVerificationStatus verificationStatus;
    }

    struct IdentityPersonalData {
        //Personal data
        string salutation; // !=0  (Mr Ms Mx )
        string firstname;
        string lastname; //!=0
        PersonType personType; // !=0
        address walletAddress; // !=0
    }

    struct IdentityContactData {
        string email; // !=0
        bool emailVerified;
        string mobileNumber;
    }

    struct IdentityFinancialData {
        //Identity Financial Data
        string taxId;
    }

    struct IdentityAdditionalData {
        //general  data
        string education;
        Maritalstatus maritalstatus;
        string nationality; //  !=0
        string[] furtherNationalities;
        BirthData birthdata;
        string title; // Dr , Prof, other
        string profession;
    }

    function setPersonalData(
        string memory _salutation,
        string memory _firstname,
        string memory _lastname,
        PersonType _personType,
        address _walletAddress
    ) public pure returns (IdentityPersonalData memory) {
        return
            IdentityPersonalData({
                salutation: _salutation,
                firstname: _firstname,
                lastname: _lastname,
                personType: _personType,
                walletAddress: _walletAddress
            });
    }

    function setContactData(
        string memory _email,
        bool _emailVerified,
        string memory _mobileNumber
    ) public pure returns (IdentityContactData memory) {
        return
            IdentityContactData({
                email: _email,
                emailVerified: _emailVerified,
                mobileNumber: _mobileNumber
            });
    }

    function setAdditionalData(
        Maritalstatus _Maritalstatus,
        string memory _education,
        string memory _nationality,
        string[] memory _furtherNationalities,
        string memory _dateOfBirth,
        string memory _placeOfBirth,
        string memory _countryOfBirth,
        string memory _title,
        string memory _profession
    ) public pure returns (IdentityAdditionalData memory) {
        return
            IdentityAdditionalData({
                maritalstatus: _Maritalstatus,
                nationality: _nationality,
                education: _education,
                furtherNationalities: _furtherNationalities,
                birthdata: BirthData({
                    dateOfBirth: _dateOfBirth,
                    placeOfBirth: _placeOfBirth,
                    countryOfBirth: _countryOfBirth
                }),
                title: _title,
                profession: _profession
            });
    }
}
